using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace ConsoleApp1
{
    class Program
    {
        static void Main(string[] args)
        {
            string mainInput = @"";

            int minLength = 1000000;
            for (int j = 65; j <= 90; j++)
            {
                string newInput = "";
                for(int k = 0; k<mainInput.Length; k++)
                {
                    if (mainInput[k] != j && mainInput[k] != (j + 32))
                    {
                        newInput += mainInput[k];
                    }
                }

                newInput = newInput.Trim();
                string input = "";
                while (input.Length != newInput.Length)
                {
                    input = newInput;
                    newInput = "";
                    int i = 0;
                    while (i < (input.Length))
                    {
                        if (i == (input.Length - 1))
                        {
                            newInput += input[i];
                            i++;
                            continue;
                        }
                        int diff = input[i] - input[i + 1];
                        if (diff == 32 || diff == -32)
                        {
                            i++;
                        }
                        else
                        {
                            newInput += input[i];
                        }
                        i++;
                    }
                }
                if(input.Length < minLength)
                {
                    minLength = input.Length;
                }
            }
            Console.WriteLine(minLength);
            Console.ReadLine();
        }
        

    }
}
